import Foundation

let handler = Handler()
let server = Server(port: 9999)
try? server.start()

class Handler {
    
    let testData:[Data?] = [
        Data(hexadecimal: ""),
        Data(hexadecimal: ""),
        Data(hexadecimal: ""),
        Data(hexadecimal: ""),
        Data(hexadecimal: ""),
    ]
    
    @objc func onServerHasConnection(notification:Notification) {
        if let connection = notification.object as? Connection {

            connection.send("Why, hello there! We're going to load some test data in 2 seconds...\n\n")
            
            DispatchQueue.main.asyncAfter(deadline: .now() + 2) { [weak self] in
                if let strongSelf = self {
                    for item in strongSelf.testData {
                        if let data = item {
                            connection.send(data: data)
                        }
                    }
                    connection.send("\n\nTest data has been sent, you can disconnect now!")
                }
            }
        }
    }
    
}

NotificationCenter.default.addObserver(
    handler,
    selector: #selector(handler.onServerHasConnection),
    name: .serverHasConnection,
    object: nil)


CFRunLoopRun()

